import React from "react";
import styled from "styled-components";
import Header from "../header-web";

const Container = styled.div`
    display: flex;
    flex-direction: column;
    width: 80%;
    margin-top: 40px;
    margin-left: 80px;
`

const TechnologyMahasay: React.FC = () => {

    function postYourAdd () {
        var iframe = $("#forPostyouradd");
        iframe.attr("src", iframe.data("src")); 
    }



    return <>
        <Header />
        <ChatWrapper>Chat with us</ChatWrapper>
        <iframe id="forPostyouradd" data-src="http://www.w3schools.com" src="about:blank" width="200" height="200" style={{ background: '#ffffff' }}></iframe>

    </>
}


export default TechnologyMahasay;

const ChatWrapper = styled.div`
    position: fixed;
    bottom: 0;
    right: 0;
	margin: 80px;
    background: #4bc84b;
    padding: 8px;
    border-radius: 17px;
    overflow: hidden;
    z-index: 200;
    cursor: pointer;
`;
